class FeedPanel extends Component{
    constructor(props){
        super(props)
        this.state = {
            map: null,
            count: "0 Results",
            itemsFromLoad: 0,
            itemsToLoad: 100
        }
        this.singleDigit = this.singleDigit.bind(this)
    }

    singleDigit(value){
        while (value > 9) {
          value
            .toString()
            .split('')
            .map(Number)
            .reduce(function (a, b) {return value = a + b}, 0)
        } return value
      }

    render(){

        const { t } = this.props

        /*
